    render() {
        const books = this.props.books;
        const bookItems = books.map( book => {
            return (
                <ListItem>
                    <BookListItem book={book} />
                </ListItem>
            )

        })
        return (
            <List>
                <ListItem>
                    <BookListItem book={books[0]} />
                    {books[0].title}
                </ListItem>
                <ListItem>
                     {books[1].title}
                </ListItem>
                <ListItem>
                    {books[2].title}
                </ListItem>
            </List> 
        )
    }
}

